import React, { useState, useEffect, useContext } from 'react'
import './ButtonFeladatok.css';
import buttonFeladatok from '../../assets/buttonFeladatok.png'
import { containerContext } from '../Container'



function ButtonFeladatok() {


  const context = useContext(containerContext)

  function handleClick(e) {
    console.log('buttonfeladatok click', e)
    context.setVisibleFeladatok(true)
  }

  let contextExtract = context[0]

  const contextFunction = context[1]

    return (
      <div>
        {console.log('buttonfeladatok contaxtextract ', contextExtract)}
        {console.log('buttonfeladatok contaxtfunction ', contextFunction)}
        <div id = 'buttonFeladatok'>
          <div className="flip-box">
            <div className="flip-box-inner">
              <div className="flip-box-front">
                <img src = {buttonFeladatok} alt = 'oktatas' ></img>
              </div>
              <div className="flip-box-back">
                <img src = {buttonFeladatok} alt = 'oktatas' onClick={(e) => contextFunction()} ></img>
              </div>
            </div>
          </div>
        </div>
      </div>

    );
  }


export default ButtonFeladatok;
